187f0f83986b0269e8d0860e24c1b40ef4243ccb.source:
query IssuesAndCommentsForRepository {
  repository(name: "apollo-ios", owner: "apollographql") {
    __typename
    name
    issues(last: 100) {
      __typename
      nodes {
        __typename
        title
        author {
          __typename
          ...AuthorDetails
        }
        body
        comments(last: 100) {
          __typename
          nodes {
            __typename
            body
            author {
              __typename
              ...AuthorDetails
            }
          }
        }
      }
    }
  }
}
fragment AuthorDetails on Actor {
  __typename
  login
  ... on User {
    __typename
    id
    name
  }
}

68de6d66c791c0d7b4fe4c21496b4623acb91c00.source:
query Repository {
  repository(owner: "apollographql", name: "apollo-ios") {
    __typename
    issueOrPullRequest(number: 13) {
      __typename
      ... on Issue {
        __typename
        body
        ... on UniformResourceLocatable {
          __typename
          url
        }
        author {
          __typename
          avatarUrl
        }
      }
      ... on Reactable {
        __typename
        viewerCanReact
        ... on Comment {
          __typename
          author {
            __typename
            login
          }
        }
      }
    }
  }
}
